import{_ as a,o as e,c as t,O as n}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 58.1-3261 Annual assessment of real estate in certain other cities and counties.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/58.1-3261.md","filePath":"vacode/58.1-3261.md"}'),s={name:"vacode/58.1-3261.md"},o=n('<h1 id="§-58-1-3261-annual-assessment-of-real-estate-in-certain-other-cities-and-counties" tabindex="-1">§ 58.1-3261 Annual assessment of real estate in certain other cities and counties. <a class="header-anchor" href="#§-58-1-3261-annual-assessment-of-real-estate-in-certain-other-cities-and-counties" aria-label="Permalink to &quot;§ 58.1-3261 Annual assessment of real estate in certain other cities and counties.&quot;">​</a></h1><p>The following acts are incorporated in this Code by this reference:</p><ol><li><p>Chapter 32 of the Acts of Assembly of 1956, approved February 13, 1956, as amended by Chapter 33 of the Acts of Assembly of 1958, authorizing provision for annual assessments of real estate and equalization of assessments in cities of not less than 70,000 and not more than 125,000 inhabitants, but not in cities of not less than 90,000 and not more than 100,000 inhabitants.</p></li><li><p>Chapter 348 of the Acts of Assembly of 1956, approved March 14, 1956, authorizing provision for annual assessment of real estate in any county having a population of more than 99,000 and adjoining 3 or more cities lying entirely within the State.</p></li><li><p>Chapter 383 of the Acts of Assembly of 1956, approved March 14, 1956, authorizing provision for annual assessments of real estate and equalization thereof, in any county having a population of more than 22,000 but less than 23,000.</p></li><li><p>Chapter 56 of the Acts of Assembly of 1959, Ex. Sess., approved April 27, 1959, authorizing provision for annual assessments of real estate and equalization of assessments in any city having a population of more than 25,000 and less than 34,000.</p></li><li><p>Chapter 548 of the Acts of Assembly of 1964, approved March 31, 1964, providing for annual assessment and equalization of assessments in any county having a population of more than 20,000 but less than 50,000 and adjoining a county having a population of more than 200,000.</p></li><li><p>Chapter 584 of the Acts of Assembly of 1964, approved March 31, 1964, authorizing provision for annual assessment of real estate and equalization of assessments in any city having a population of more than 92,000 and less than 110,000.</p></li><li><p>Chapter 311 of the Acts of Assembly of 1966, authorizing provision for annual assessment and equalization of assessments of real estate in any county adjoining two cities of the first class and in which a military fort is located.</p></li></ol><p>Code 1950, § 58-769.1; 1984, c. 675.</p>',4),i=[o];function r(l,h,f,p,c,d){return e(),t("div",null,i)}const _=a(s,[["render",r]]);export{m as __pageData,_ as default};
